import React from "react";
import StudentsCard from "./StudentsCard";
import "./SuperviseStudents.css";

const ListCards = ({ card }) => {
  let content = "";
  if (card instanceof Function) {
    const resulte = card.map((card) => (
      <StudentsCard key={card.UserName} card={card} />
    ));

    content = resulte?.length ? (
      resulte
    ) : (
      <p className="p-Students-Card"> لا يوجد طلاب تحت اشرافك </p>
    );
  } else {
    const resulte = <StudentsCard key={card.UserName} card={card} />;

    content = resulte?.length ? (
      resulte
    ) : (
      <p className="p-Students-Card"> لا يوجد طلاب تحت اشرافك </p>
    );
  }

  return <div>{content}</div>;
};

export default ListCards;
